import './App.css';

import Navbar from "./components/Navbar";


import AboutContact from './pages/AboutContact';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';

import MacTop from "./single-use-elements/MacTop"
//si pongo mac top aqui si que se ve pero ob¡bviamente esta en todas las páginas, si lo pongo dentro de AboutContact no 

function App() {
  return (
    <div className="App">
      <Router>
        <MacTop/>
        <Routes>
          <Route path='/AboutContact' element={<AboutContact/>} />
        </Routes>
        <Navbar/>
      </Router>
    </div>
  );
}

export default App;
